import React from 'react';

const DashboardTitle = () => {
  return (
    <div className="bg-white rounded-2xl shadow-lg p-8 mb-8">
      <div className="flex items-center space-x-4">
        <div className="w-16 h-16 rounded-full flex items-center justify-center" style={{ backgroundColor: 'rgba(141, 233, 113, 0.1)' }}>
          <svg className="w-8 h-8" style={{ color: '#8DE971' }} fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
          </svg>
        </div>
        <div>
          <h1 className="text-3xl font-bold" style={{ color: '#030304' }}>IMIB & ACE Live Monitoring Dashboard</h1>
          <p className="mt-1" style={{ color: '#030304', opacity: 0.7 }}>Live integration platform monitoring</p>
        </div>
      </div>
    </div>
  );
};

export default DashboardTitle;
